import { BrowserRouter as Router, Switch, Route, Routes} from "react-router-dom";



function App() {
  return (
    <Routes >
    {/* If the current URL is /about, this route is rendered
        while the rest are ignored */}
        <Route path="/home">
      <Homepage />
    </Route>
    <Route path="/about">
      <About />
    </Route>
    </Routes >
)
}

export default App;
